import React from "react";
import S from "./style";
import { ReactComponent as BellIcon } from '../../icons/bell.svg';
import { ReactComponent as SendIcon } from '../../icons/send.svg';
import { ReactComponent as CalendarIcon } from '../../icons/calendar.svg';
import BasicButton from "../../button/BasicButton";
import Text from "../../text/size";

const Header = ({ isLoggedIn, user }) => {
    return (
        <S.HeaderWrapper>

            <S.LogoWrapper>
                <img src="/assets/img/logo.svg" alt="MungPick 로고" />
            </S.LogoWrapper>

            <S.Menu>
                {isLoggedIn ? (
                    <>
                        <Text.Body3>친구들 보러가기</Text.Body3>
                        <Text.Body3>FAQ</Text.Body3>
                        <Text.Body3>멍게시판</Text.Body3>
                    </>
                ) : (
                    <>
                        <Text.Body3>FAQ</Text.Body3>
                        <Text.Body3>이용후기</Text.Body3>
                    </>
                )}
            </S.Menu>

            <S.RightMenu>
                {isLoggedIn ? (
                    <>
                        <S.Badge>
                            <BellIcon />
                            <S.BadgeCount>2</S.BadgeCount>
                        </S.Badge>

                        <S.Badge>
                            <SendIcon />
                            <S.BadgeCount>5</S.BadgeCount>
                        </S.Badge>

                        <S.Badge>
                            <CalendarIcon />
                            <S.BadgeCount>1</S.BadgeCount>
                        </S.Badge>

                        <S.ProfileImg src={user?.profileImage} alt="프로필" />
                    </>
                ) : (
                    <>
                        <BasicButton variant="filled" roundButton="small">로그인</BasicButton>
                        <BasicButton variant="filled" roundButton="small">회원가입</BasicButton>
                    </>
                )}
            </S.RightMenu>
        </S.HeaderWrapper>
    );
};

export default Header;
